import groovy.sql.*
import  com.eviware.soapui.support.XmlHolder 
import java.util.*

def conUrl= context.expand('${#Project#con}')
def driver = context.expand('${#Project#driver}')
com.eviware.soapui.support.GroovyUtils.registerJdbcDriver(driver)

def query = context.expand('${#Project#isoCodesQeury1}')
def baseCon =Sql.newInstance(conUrl,driver)
def isoCodes=new ArrayList<String>()
baseCon.eachRow(query){row ->
	isoCodes.add(row.isoCode)
}

def xmlResp = messageExchange.response.responseContent
def xml= new XmlHolder(xmlResp)
def isoResponse = xml.getNodeValue("// m:sISOCode")
def assertIsoCode = isoCodes.contains(isoResponse)
 log.info "isoCode from sql and from api response are the same, status:"+ assertIsoCode
assert  assertIsoCode

import groovy.sql.*
import  com.eviware.soapui.support.XmlHolder 
import java.util.*

def conUrl= context.expand('${#Project#con}')
def driver = context.expand('${#Project#driver}')
com.eviware.soapui.support.GroovyUtils.registerJdbcDriver(driver)

def query = context.expand('${#Project#isoCodesQeury2}')
def baseCon =Sql.newInstance(conUrl,driver)
def names=new ArrayList<String>()
baseCon.eachRow(query){row ->
	names.add(row.name)
}

def xmlResp = messageExchange.response.responseContent
def xml= new XmlHolder(xmlResp)
def nameResponse = xml.getNodeValue("//m:sName")
def assertName = names.contains(nameResponse)
 log.info "name from sql and from api response are the same, status:" + assertName
assert  assertName
